INSERT INTO `article` VALUES ('13', '强哥', '从测试的角度来说，我们应该从哪此点入手', 'Chrome为我们分析JavaScript脚本的执行性能提供了包括CPU消耗情况，代码执行时间，内存消耗情况，对象被调用次数等。可以帮助我们快速地找出前端JS脚本的瓶颈，并进行合理的优化。但是，目前由于很多Web前端开发工程师都会优先使用各种JS框架，反而自己写的JS代码比较少了，这种情况下，这类分析显得意义不大。即使发现了问题很多程序员也不一定能够进行优化。\r<br/>\r<br/>Chrome为我们分析JavaScript脚本的执行性能提供了包括CPU消耗情况，代码执行时间，内存消耗情况，对象被调用次数等。可以帮助我们快速地找出前端JS脚本的瓶颈，并进行合理的优化。但是，目前由于很多Web前端开发工程师都会优先使用各种JS框架，反而自己写的JS代码比较少了，这种情况下，这类分析显得意义不大。即使发现了问题很多程序员也不一定能够进行优化。\r<br/>\r<br/>Chrome为我们分析JavaScript脚本的执行性能提供了包括CPU消耗情况，代码执行时间，内存消耗情况，对象被调用次数等。可以帮助我们快速地找出前端JS脚本的瓶颈，并进行合理的优化。但是，目前由于很多Web前端开发工程师都会优先使用各种JS框架，反而自己写的JS代码比较少了，这种情况下，这类分析显得意义不大。即使发现了问题很多程序员也不一定能够进行优化。', '1', '2021-06-17 18:13:53');
INSERT INTO `article` VALUES ('14', 'qiang', '函数节流的概念', '函数节流是指规定一个单位时间，在这个单位时间内，只能有一次触发事件的回调函数执行，如果在同一个单位时间内某事件被触发多次，只有一次能生效。节流可以使用在 scroll 函数的事件监听上，通过事件节流来降低事件调用的频率。', '1', '2021-06-18 10:57:31');
INSERT INTO `article` VALUES ('15', 'woniu', 'NASA向神舟十二号发射成功道贺', '6月17日，美国航天局（NASA）官方网站刊登了局长比尔·纳尔逊对中国神舟十二号载人飞船发射成功的祝贺，贺词写道：祝贺中国成功地将航天员送入空间站！我对后续的科研成果表示期待。\r\n<br/>\r\n<br/><img src=\"http://www.woniuxy.com/page/img/footer-img.png\"/>', '3', '2021-06-18 15:29:23');
